import "./App.css";
import RootLayout from "./layouts/RootLayout";
import AddProduct from "./pages/AddProduct";
import HomePage from "./pages/HomePage";
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import ProductsPage from "./pages/ProductsPage";
import ProductDetails, {
  loader as productDetailsLoader,
} from "./pages/ProductDetails";
import { loader as productsLoader } from "./pages/ProductsPage";
import ErrorPage from "./pages/ErrorPage";
import DefaultPage from "./pages/DefaultPage";

const router = createBrowserRouter([
  {
    path: "/",
    element: <RootLayout />,
    children: [
      { index: true, element: <HomePage /> },
      {
        path: "products",
        children: [
          { index: true, loader: productsLoader, element: <ProductsPage /> },
          {
            path: ":productId",
            id: "product-detail",
            loader: productDetailsLoader,
            element: <ProductDetails />,
          },
        ],
      },
      { path: "shoppingBag", element: <DefaultPage /> },
      { path: "checkout", element: <DefaultPage /> },
      { path: "orders", element: <DefaultPage /> },
      {
        path: "*",
        element: <ErrorPage />,
      },
    ],
  },
  {
    path: "/admin",
    element: <RootLayout />,
    children: [
      { index: true, element: <ProductsPage /> },
      { path: "products", element: <ProductsPage /> },
      { path: "add-product", element: <AddProduct /> },
    ],
  },
]);

function App() {
  return (
    <div className="App">
      <RouterProvider router={router} />
    </div>
  );
}

export default App;
